import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  // State for the counts
  const [studentsAppearing, setStudentsAppearing] = useState(0);
  const [studentsCleared, setStudentsCleared] = useState(0);

  useEffect(() => {
    // Counter logic for students appearing
    const appearingInterval = setInterval(() => {
      setStudentsAppearing((prev) => {
        if (prev < 1415100) {
          return prev + 1000; // Increment by 1000
        }
        clearInterval(appearingInterval); // Stop the interval when the target is reached
        return prev;
      });
    }, 10);

    // Counter logic for students cleared
    const clearedInterval = setInterval(() => {
      setStudentsCleared((prev) => {
        if (prev < 49164) {
          return prev + 100; // Increment by 100
        }
        clearInterval(clearedInterval); // Stop the interval when the target is reached
        return prev;
      });
    }, 20);

    return () => {
      clearInterval(appearingInterval);
      clearInterval(clearedInterval);
    };
  }, []);

  return (
    <div style={{ textAlign: 'center', padding: '20px' }}>
      <h1 style={{
        fontSize: '48px',
        margin: '20px 0',
        fontWeight: 'bold',
        background: 'linear-gradient(to right, #FF6347, #FFD700, #32CD32)',
        WebkitBackgroundClip: 'text',
        color: 'transparent'
      }}>
        Welcome to Web DailiGo
      </h1>
      <p style={{ fontSize: '24px', margin: '20px 0' }}>
        Your one-stop platform for managing your learning experience.
        <br />
        Whether you're a new student or a returning learner, we have something for you!
      </p>

      {/* Statistics Section */}
      <div style={{ marginTop: '50px' }}>
        <h2 style={{ fontSize: '36px', color: '#9B1B30' }}>Statistics</h2>
        <div style={{ display: 'flex', justifyContent: 'center', margin: '20px 0' }}>
          <div style={{
            backgroundColor: '#FF7F50',
            color: 'white',
            padding: '20px',
            borderRadius: '5px',
            margin: '0 20px',
            fontSize: '24px',
            width: '250px'
          }}>
            <h3>Students Appearing for JEE:</h3>
            <p style={{ fontSize: '48px', fontWeight: 'bold' }}>{studentsAppearing}</p>
          </div>
          <div style={{
            backgroundColor: '#FF7F50',
            color: 'white',
            padding: '20px',
            borderRadius: '5px',
            margin: '0 20px',
            fontSize: '24px',
            width: '250px'
          }}>
            <h3>Students Cleared Exam:</h3>
            <p style={{ fontSize: '48px', fontWeight: 'bold' }}>{studentsCleared}</p>
          </div>
        </div>
      </div>

      {/* Help Callback Section */}
      <div style={{
        marginTop: '50px',
        backgroundColor: '#9B1B30',
        color: 'white',
        padding: '30px',
        borderRadius: '10px',
        maxWidth: '800px',
        margin: '20px auto',
        boxShadow: '0 4px 20px rgba(0, 0, 0, 0.1)',
      }}>
        <h2 style={{
          fontSize: '28px',
          marginBottom: '15px',
          fontWeight: 'bold',
          textAlign: 'center'
        }}>
          Need Help? Get a Callback!
        </h2>
        <p style={{
          fontSize: '18px',
          lineHeight: '1.6',
          textAlign: 'center',
          marginBottom: '20px'
        }}>
          Have any questions or need guidance on how to use Dailigo? Our team is here to help!
          Whether it's about navigating the platform, finding the right mentor, or resolving technical issues,
          simply request a callback and we’ll get in touch.
        </p>

        <h3 style={{
          fontSize: '24px',
          marginBottom: '10px',
          fontWeight: 'bold',
          textAlign: 'center'
        }}>
          Contact Details
        </h3>

        <div style={{
          marginBottom: '20px',
          textAlign: 'center'
        }}>
          <p style={{ fontSize: '18px' }}>
            <strong>Name:</strong> Gaurav Rastogi
          </p>
          <p style={{ fontSize: '18px' }}>
            <strong>Phone:</strong> +91-9628233872
          </p>
          <p style={{ fontSize: '18px' }}>
            <strong>Email:</strong> <a href="mailto:dailigo@gmail.com" style={{ color: 'lightblue', textDecoration: 'underline' }}>dailigo@gmail.com</a>
          </p>
        </div>

        <div style={{
          textAlign: 'center'
        }}>
          <button style={{
            padding: '10px 20px',
            fontSize: '16px',
            marginTop: '10px',
            backgroundColor: 'blue',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
            transition: 'background-color 0.3s'
          }}
            onMouseEnter={e => e.target.style.backgroundColor = '#007BFF'}
            onMouseLeave={e => e.target.style.backgroundColor = 'blue'}>
            Place a Callback
          </button>
        </div>
      </div>

      {/* Social Media Icons positioned on the side */}
      <div style={{
        position: 'fixed',
        right: '0',
        top: '50%',
        transform: 'translateY(-50%)',
        zIndex: '1000',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      }}>
        <a href="https://www.instagram.com/shekhar.prajapat1/"
          target="_blank"
          rel="noopener noreferrer"
          style={{ margin: '10px', color: '#E1306C', fontSize: '30px' }}>
          <i className="fab fa-instagram"></i>
        </a>
        <a href="https://www.facebook.com/profile.php?id=100073593939184"
          target="_blank"
          rel="noopener noreferrer"
          style={{ margin: '10px', color: '#1877F2', fontSize: '30px' }}>
          <i className="fab fa-facebook"></i>
        </a>
        <a href="https://www.linkedin.com/in/shekhar-prajapat-92576a210/"
          target="_blank"
          rel="noopener noreferrer"
          style={{ margin: '10px', color: '#0A66C2', fontSize: '30px' }}>
          <i className="fab fa-linkedin"></i>
        </a>
      </div>

      {/* Login Button positioned at the corner */}
      <Link to="/login" style={{
        position: 'fixed',
        top: '20px',
        right: '20px',
        textDecoration: 'none',
        backgroundColor: 'blue',
        color: 'white',
        padding: '10px 20px',
        borderRadius: '5px',
        fontSize: '16px',
        zIndex: '1000'
      }}>
        Login
      </Link>
    </div>
  );
};

export default Home;
